INSERT INTO `products` VALUES (1,0,'5050 mAh','Li-Ion','Google','Obsidian Black','Type-C','2025-10-13 17:51:55.919601','Chiếc điện thoại thông minh từ Google với camera xuất sắc và các tính năng AI độc quyền.','Pixel 9 Pro mang lại trải nghiệm Android thuần khiết nhất cùng hệ thống camera AI thông minh bậc nhất thế giới.','Dài 162.1 mm - Ngang 76.5 mm - Dày 8.5 mm',_binary '\0',0,'Chip Google Tensor G4 tối ưu cho các tác vụ máy học và AI, mang lại hiệu năng thông minh và mượt mà.',0,'12 GB','256 GB','6.7 inch - LTPO OLED, 120Hz','Google Pixel 9 Pro','2025-10-29 16:53:14.590736',0,'215 g',2),(2,0,'5000 mAhC','Li-PoC','XiaomIIII','Trắng tinh CCCCCC','Type-CCCC','2025-10-13 17:51:55.953818','Flagship từ Xiaomi với camera Leica danh tiếng và công nghệ sạc siêu nhanh 120W. CCCCC','Xiaomi 15 Pro hợp tác cùng Leica, mang đến chất lượng hình ảnh chuyên nghiệp và hiệu năng hàng đầu. CCCCCCCCCCCCC','161.4 x 75.3 x 8.5 mm CC',_binary '\0',0,'Trang bị Snapdragon 8 Gen 4, Xiaomi 15 Pro là một \'quái vật\' hiệu năng trong thế giới Android. CCCCCCCCCCCCCCCC',0,'16 GCC','512 GBCC','6.73 inch -CC','Sang ','2025-10-29 16:54:03.185298',0,'220 g CC',3),(3,0,'4400 mAh','Li-Po','Samsung','Đen Phantom','Type-C','2025-10-13 17:51:55.985058','Điện thoại gập cao cấp của Samsung, kết hợp giữa smartphone và máy tính bảng.','Galaxy Z Fold 6 là đỉnh cao của công nghệ điện thoại gập, mang lại trải nghiệm đa nhiệm như một chiếc máy tính bảng.','Gập: 154.9 x 67.1 x 13.4 mm, Mở: 154.9 x 129.9 x 6.1 mm',_binary '',0,'Với Snapdragon 8 Gen 4 for Galaxy, mọi tác vụ trên màn hình lớn đều được xử lý một cách trơn tru.',0,'12 GB','256 GB','Màn hình chính 7.6 inch, Màn hình phụ 6.2 inch','Samsung Galaxy Z Fold 6','2025-10-13 17:51:55.985075',0,'253 g',4),(4,5,'5100 mAh','Li-Po','OPPO','Xanh Lục Bảo','Type-C','2025-10-13 17:51:56.017556','Chuyên gia nhiếp ảnh di động với thiết kế sang trọng và màn hình hiển thị sống động.','Find X8 Pro tiếp tục khẳng định vị thế của OPPO trong lĩnh vực nhiếp ảnh di động với